import React, { useEffect } from "react"
import { Flex, Button, Text, Box, Image } from "rebass"
import { Input, Select } from "@rebass/forms"

const TabButton = props => (
	<Button
		variant="primary"
		width="1.34rem"
		height="0.38rem"
		bg="#000000"
		color="#ffffff"
		mt={"5.8%"}
		padding="0"
		sx={{
			borderRadius: 0,
			fontSize: "0.14rem"
		}}
	>
		LOADING
	</Button>
)

export default props => {
	return (
		<Flex
			alignItems="center"
			height="80px"
			pl="24px"
			sx={{
				cursor: "pointer",
				"&:hover": {
					background: "rgba(255, 255, 255, 0.5)"
				}
			}}
		>
			<Input
				width="3rem"
				height="0.38rem"
				id="username"
				name="username"
				type="text"
				placeholder="STYLE NUMBER"
			/>
			<Flex>
				<Flex>
					<Box>AREA</Box>
				</Flex>
			</Flex>
		</Flex>
	)
}
